    <>
    <Header />
    <ProjectCard name="RockClimber" img="./assets/imgs/Capture.PNG" github="https://github.com/Jack-Storment/North-Carolina-Rock-Climbing" deployed="https://www.northcarolinarockclimbing.com/" />
    <ProjectCard name="RockClimber" img="./assets/imgs/Capture.PNG" github="https://github.com/Jack-Storment/North-Carolina-Rock-Climbing" deployed="https://www.northcarolinarockclimbing.com/" />
    </>
      )
}

export default App;
